window.bookSummaryJSON = "<p><b>Astrid is the kind of Hunter that all Hunters aspire to be: lethal, focused, ambidextrous.</b></p> <p>In contrast to her disgraced sister, Astrid has done everything right. Now, she’s coming to realize that everything she’s ever known is wrong.</p> <p>Soren wants to be the kind of Shade that all Shades aspire to be: brave, decisive, powerful.</p> <p>But his disgraced sister is determined to ruin him, and now there’s a deadly Hunter in his realm, smelling like the most delicious thing he’d ever taste.</p> <p>And the king wants them to work together.</p> <p>Can they hold the enemy line with each other? Or will the thin line between love and hate be their undoing?</p> <p><i>Superbia </i>is the second book in the Shades of Sin series, featuring humans and their not-quite-human partners. Intended for mature listeners.</p>"; 
